import React from 'react';

const Feedback = ({ text, author, photo }) => {
  return (
    <div className='flex justify-around items-center space-x-'>
        <img src={photo} alt="Feedback" className='w-72' />
        <div >
            <p>{text}</p>
            <p className='font-semibold'>- {author}</p>
        </div>
    </div>
  );
};

export default Feedback;
